import React from 'react';
import homeCSS from './home.module.css';
import PlaquesArt from './PlaquesArt';
import plaquesCSS from './plaques.css';

function Home() {
  return (
    <div id={homeCSS.background}>
        <p className={homeCSS.helloText}>Hello Home</p>
        <PlaquesArt />
        {/* <img src="./images/slantedGreenLake.png" id = "Slanted_Green_Lake" width = "170" alt = "Green Lake"/>
        <img src = "./images/Ghibili_House.jpg" id = "Ghibili_House" height = "150"  alt = "Ghibili_House"></img>
        <img src = "./images/Carosel_Path.jpg" id = "Carosel_Path" height = "150"  alt = "Carosel_Path"></img>
        <img src="./images/slantedCoolingMist.png" id = "Slanted_Cooling_Mist" height = "260"  alt = "Cooling Mist"></img>
        <img src="./images/closed-door.jpg" id = "closed-door" height = "200"></img> */}

        <img src="./images/slantedGreenLake.png" id = {homeCSS.Slanted_Green_Lake} width = "170" alt = "Green Lake"/>
        <img src = "./images/Ghibili_House.jpg" id = "Ghibili_House" height = "150"  alt = "Ghibili_House"></img>
        <img src = "./images/Carosel_Path.jpg" id = "Carosel_Path" height = "150"  alt = "Carosel_Path"></img>
        <img src="./images/slantedCoolingMist.png" id = "Slanted_Cooling_Mist" height = "260"  alt = "Cooling Mist"></img>
        <img src="./images/closed-door.jpg" id = "closed-door" height = "200"></img>

    </div>
  )
}

export default Home;
